This bull fresco of Knossos dates to 1450 BC, over a thousand years before construction of the Parthenon. Still, the Minoan civilization was in terminal decline by the time this scene catering to the cult of the bull was created. Its people having established the first western state in 3000 BC with the palace at Knossos serving as a administrative centre from 1900 BC onwards. 

The scale of the palace complex and its labyrinthine design gave rise to the myth of Daedalus‚Äôs maze, under which lived the Minotaur. It seems absurd to us now, but in absence of science, the Greeks attributed the frequent earthquakes ravaging Crete to a subterranean monster who would shake the ground whenever angered. The mythical King Minos of Crete attempted to placate this beast with annual tribute in the form of youth from other Greek settlements until one of the intended sacrifices, a man by the name of Theseus was able to slay it. 

In reality, the human sacrifices had no impact on seismology and the volcanic eruption at Thera (modern day Santorini) in ~1600 BC devastated the Minoans such that they were never able to recover. Critically, the settlement of Akrotiri on Santorini itself sank beneath the waves ‚Äî an event memorialized in the fable of Atlantis. 

The remnants of the Minoans were then gradually subjugated by the Mycenaeans from the mainland. It is logical to assume that the tales of the titanomachy, a struggle between the titans of old and the new olympians reflect the eruption at Thera and the fall of the once dominant Minoan empire to the newly established Mycenaeans. Nothing would legitimize such an event more so than the mythical founder of Athens (Theseus) slaying the very symbol of the Minoan empire (The Minotaur) at its heart (Knossos).";}i:30;a:1:{s:14:"comments_count";i:1;}i:31;a:1:{s:11:"likes_count";i:1;}i:32;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu_4wjsZCU";}i:33;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118774439_745801132927812_3736963417693065880_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=100&_nc_ohc=XVFgCMMKE0cAX83AlrP&oh=aca35a3c1d954444fd7366add2b816de&oe=5F7D366E";}i:34;a:1:{s:4:"type";s:5:"image";}i:35;a:1:{s:8:"owner_id";i:1905381045;}i:36;a:1:{s:14:"owner_username";s:0:"";}i:37;a:1:{s:14:"owner_fullname";s:0:"";}i:38;a:1:{s:9:"owner_pic";s:0:"";}i:39;a:1:{s:2:"id";s:19:"2391128715792177427";}i:40;a:1:{s:10:"short_code";s:11:"CEu_uX1B1kT";}i:41;a:1:{s:12:"created_time";i:1599264777;}i:42;a:1:{s:7:"caption";s:395:"Just in case you forgot what I looked like , here is meüåø 

